//  designing my small project 

import React from "react";
import ReactDom from "react-dom";

ReactDom.render(
    <>
        <div className="cards">
            <div className="card">
                <img src="" alt="my pic" className="card_img" />
                <div className="card_info">
                    <span className="card_category"></span>
                    <span className="card_title"></span>
                </div>
            </div>
        </div>
  </>,document.getElementById("root")  
);
